    data() {
      return {
        wfAdd: [
          {name: '热点1号', add: [37.799223, 119.044141],},
          {name: '热点2号', add: [37.759223, 119.023141],},
          {name: '热点3号', add: [37.779223, 119.042141],},
          {name: '热点4号', add: [37.739223, 119.041141],},
          {name: '热点5号', add: [37.759223, 119.040141],},
        ],
        bsAdd: [
          {name: '基站1号', add: [37.723223, 119.141141],},
          {name: '基站2号', add: [37.723223, 119.041141],},
          {name: '基站3号', add: [37.823223, 119.141141],},
          {name: '基站4号', add: [37.653223, 119.141141],},
          {name: '基站5号', add: [37.703223, 119.101141],},
          {name: '基站6号', add: [37.829223, 119.041141],},
          {name: '基站7号', add: [37.829223, 119.001141],},
          {name: '基站8号', add: [37.729223, 119.101141],},
          {name: '基站9号', add: [37.829223, 119.041141],},
          {name: '基站10号', add: [37.789223, 119.001141],},
          {name: '基站11号', add: [37.799223, 119.041141],},
          {name: '基站12号', add: [37.829223, 119.121141],},
        ],
        bpAdd: [
          {
            name: '红地毯景区',
            url: 'data:image/png;base64,',
            add: [37.769223, 118.944141],

          },
          {
            name: '东方白鹤观赏区',
            url: 'data:image/png;base64,',
            add: [37.699223, 118.933141],
          },
          {
            name: '北边浮桥',
            url: 'data:image/png;base64,',
            add: [37.789223, 119.042141],
          },
          {
            name: '望远楼',
            url:'data:image/png;base64,',
            add: [37.799223, 119.141141],
          },
          {
            name: '柳林栈道',
            url:'data:image/png;base64,',
            add: [37.689223, 119.040141],
          },
          {
            name: '百鸟园',
            url:'data:image/png;base64,',
            add: [37.689223, 119.000141],
          },
        ],
        pzAdd: [
          {
            name: '白鹳',
            text: '国家一级保护动物',
            url: 'data:image/png;base64,',
            add: [[37.733223, 119.14241],
              [37.783223, 119.17241],
              [37.783223, 119.27241],
              [37.733223, 119.26241],
              [37.700223, 119.20241],],
          },
          {
            name: '丹顶鹤白头鹤',
            text: '国家一级保护动物',
            url: 'data:image/png;base64,',
            add: [[37.733223, 119.04241],
              [37.763223, 119.07241],
              [37.763223, 119.17241],
              [37.733223, 119.16241],
              [37.710223, 119.10241],],
          },
          {
            name: '金雕',
            text: '国家一级保护动物',
            url: 'data:image/png;base64,',
            add: [[37.653223, 119.04241],
              [37.683223, 119.07241],
              [37.683223, 119.14241],
              [37.653223, 119.16241],
              [37.630223, 119.10241],],
          },
          {
            name: '中华秋沙鸭',
            text: '国家一级保护动物',
            url: 'data:image/png;base64,',
            add: [[37.633223, 119.24241],
              [37.683223, 119.27241],
              [37.683223, 119.30241],
              [37.633223, 119.36241],
              [37.620223, 119.32241],],
          },
        ],
        wfrm: [],
        bsrm: [],
        bprm: [],
        pzrm: [],
        map: undefined,
      }
    },
    mounted() {
      const $ = require('jquery');
      const that = this;
      $('.m-button>button').click(function () {
        $(this).toggleClass('color');
        if ($(this)[0].classList.length === 3) {
          switch ($(this).index()) {
            case 1:
              that.rmwfinfo();
              break;
            case 2:
              that.rmbsinfo();
              break;
            case 3:
              that.rmbpinfo();
              break;
            case 4:
              that.rmpzinfo();
              break;
            default:
              break;
          }
        } else {
          switch ($(this).index()) {
            case 1:
              that.wfinfo();
              break;
            case 2:
              that.bsinfo();
              break;
            case 3:
              that.bpinfo();
              break;
            case 4:
              that.pzinfo();
              break;
            default:
              break;
          }
        }

      });
      this.draw();
      this.rmwfinfo();
      this.rmbsinfo();
      this.rmbpinfo();
      this.rmpzinfo();
    },

    methods: {
      wfinfo() {
        this.wfrm.map(item => {
          item.addTo(this.map);
          return 0
        });
      },
      rmwfinfo() {
        this.wfrm.map(item => {
          item.remove();
          return 0
        });
      },
      bsinfo() {
        this.bsrm.map(item => {
          item.addTo(this.map);
          return 0
        });
      },
      rmbsinfo() {
        this.bsrm.map(item => {
          item.remove();
          return 0
        });
      },
      bpinfo() {
        this.bprm.map(item => {
          item.addTo(this.map);
          return 0
        });
      },
      rmbpinfo() {
        this.bprm.map(item => {
          item.remove();
          return 0
        });
      },
      pzinfo() {
        this.pzrm.map(item => {
          item.addTo(this.map);
          return 0
        });
      },
      rmpzinfo() {
        this.pzrm.map(item => {
          item.remove();
          return 0
        });
      },

      draw() {
        const L = require('leaflet');
        this.map = L.map('mapId', this.$leafletOption);
        L.tileLayer(this.$tileLayerUrl).addTo(this.map);
        // 添加
        const wfIcon = L.icon({iconUrl: wfImg, iconSize: [30, 30],});
        const bsIcon = L.icon({iconUrl: bsImg, iconSize: [30, 30],});
        const bpIcon = L.icon({iconUrl: bpImg, iconSize: [30, 30],});
        const wlIcon = L.icon({iconUrl: wlImg, iconSize: [50, 50],});
        // test
        const marker1 =L.marker([37.743223, 119.021141],
          {
            icon:wlIcon,
            title:'Test',
            alt:'稍等',
            draggable:true,
            autoPan:true,
          }).on('click', function(ev) {
          // eslint-disable-next-line no-console
            console.log(ev);
          //alert(ev); // ev is an event object (MouseEvent in this case)
        })
        // .bindTooltip('测试')
        // .openTooltip()
        //   .addTo(this.map);
        const marker2 =L.marker([37.743223, 119.121141],
          {
            icon:wlIcon,
            title:'Test',
            alt:'稍等',
            draggable:true,
            autoPan:true,
          }).on('click', function(ev) {
          // eslint-disable-next-line no-console
          console.log(ev);
          //alert(ev); // ev is an event object (MouseEvent in this case)
        })
        // .bindTooltip('测试')
        // .openTooltip()
        //   .addTo(this.map);



        L.featureGroup([marker1, marker2])
          .bindPopup('Hello world!')
          // .on('click', function() { alert('Clicked on a member of the group!'); })
          .addTo(this.map);
        // 绘制
        let wflayer = [];
        this.wfAdd.map(item => {
          wflayer.push(L.marker(item.add, {icon: wfIcon})
            .bindPopup(this.changeDate(item))
            // .openTooltip()
            .addTo(this.map));
          return 0;
        });
        this.$set(this, 'wfrm', wflayer);





        let bslayer = [];
        this.bsAdd.map(item => {
          bslayer.push(L
            .marker(item.add, {icon: bsIcon})
            .bindPopup(this.changeDate(item))
            // .bindTooltip(this.changeDate(item))
            // .openTooltip()
            .addTo(this.map));
        });
        this.$set(this, 'bsrm', bslayer);

        let bplayer = [];
        this.bpAdd.map(item => {
          bplayer.push(L
            .marker(item.add, {icon: bpIcon})
            .bindPopup(this.changeBp(item))
            // .openTooltip()
            .addTo(this.map));
        });
        this.$set(this, 'bprm', bplayer);

        let pzlayer = [];
        this.pzAdd.map(item => {
          pzlayer.push(L.polygon(item.add, {weight: 1, color: 'red'})
            .bindPopup(this.changeZoon(item))
            .addTo(this.map));
        });
        this.$set(this, 'pzrm', pzlayer);

      },

      changeDate(data) {
        return '<div style="padding:4px 16px;color:#000;text-align: left">'
          + '<h1 style="text-align: center;font-size: 14px">详细信息</h1>'
          + '编号：' + data.name + '</br>'
          + '位置：' + '<span style="vertical-align:top;display: inline-block;height: 40px">'
          + '北纬 ' + data.add[0] + '°</br>'
          + '东经 ' + data.add[1] + '°</br></span>'
          + '</div>';
      },
      changeBp(data) {
        return '<div style="padding:4px 16px;color:#000;text-align: left">'
          + '<h1 style="text-align: center;font-size: 14px">详细信息</h1>'
          + '景点：' + data.name + '</br>'
          + '位置：' + '<span style="vertical-align:top;display: inline-block;height: 40px">'
          + '北纬 ' + data.add[0] + '°</br>'
          + '东经 ' + data.add[1] + '°</span></br>'
          + '景区图片：' + '</br>'
          + '<img style="width: 200px;" src="' + data.url + '">'
          + '</div>';
      },
      changeZoon(data) {
        return '<div style="padding:4px 16px;color:#000;text-align: left">'
          + '<h1 style="text-align: center;font-size: 14px;padding: 10px">' + data.name + '活动区</h1>'
          + '保护级别：' + data.text + '</br>'
          + '图片展示：' + '</br>'
          + '<img style="width: 200px;" src="' + data.url + '">'
          + '</div>';
      },
      goback() {
        this.$router.go(-1);
      },
